    true,nt"url": null,nt"notes": "A Class III Cultural Resources Inventory
    of Proposed Roads and Drill Pads for the McGee Mountain Geothermal Project, Humboldt
    County, NevadannChambers Group, Inc.nReno Officen1755 E Plumb LanenSuite 260nReno,
    NV 89502nnFrom July 20th to July 22nd, 2010, Chambers Group personnel conducted
    a cultural resources inventory of the project area. The recordation and inventory
    resulted in the recordation a single newly identified prehistoric site (CrNV-2-9605)
    and five isolated finds (CrNV-2-1490 to 1494). The prehistoric site is a small lithic
    scatter composed exclusively of chalcedony with two formed tools. CrNV-2-9605 is
    recommended as not eligible to the NRHP under all Criterion. The isolated finds
    consist of a single prehistoric flake and four pieces of historic debris. All of
    the isolated finds are categorically not eligible for the NRHP per the State Protocol
    Agreement between the BLM and Nevada SHPO.n",nt"owner_org": "735d0118-b2a7-4246-a0e3-608b0fa8d1ec",nt"extras":
